import React from 'react';

const Footer = () => {
  return (
    <footer className="fixed-bottom bg-light p-3">
      <p>
        <a href="#">Accueil</a> - 
        <a href="#">FAQ</a> - <a href="#">Liens utiles</a> - <a href="#">Plan du site</a> - <a href="#">Nous contacter</a>
      </p>
      <p>&copy; 2021 Société Nationale d'Exploitation et de Distribution des Eaux, Tous droits réservés.</p>
    </footer>
  );
};

export default Footer;
